# DBTITLE 1,Pick Resolution for H3 Grids
# MAGIC %md
# MAGIC 
# MAGIC __If a plane is flying at ~483 kph (300 mph), then it covers ~8 km (5 mi) per minute or ~4 km (2.5 mi) per 30 seconds or 2 km (1.25 mi) per 15 seconds which is near the interval of flight data reporting. Based on this, want hex sizes that are smaller than that minimum interval of 15 seconds, so H3 resolution 8 at .737 km^2 fits the bill.__
# MAGIC 
# MAGIC > Each subsequent resolution beyond resolution 0 is created using an aperture 7 resolution spacing (aperture refers to the number of cells in the next finer resolution grid for each cell); as resolution increases the unit length is scaled by \(\sqrt{7}\) and each hexagon has \(1/7th\) the area of a hexagon at the next coarser resolution (as measured on the icosahedron). H3 provides 15 finer grid resolutions in addition to the resolution 0 base cells. The finest resolution, resolution 15, has cells with an area of less than 1 \(m^2\). A table detailing the average cell area for each H3 resolution is available here.
# MAGIC 
# MAGIC | H3 Resolution | Average Hexagon Area (km2) | Average Hexagon Edge Length (km) | Number of unique indexes |
# MAGIC | ------------- | -------------------------- | -------------------------------- | ------------------------ |
# MAGIC |0 |4,250,546.8477000|1,107.712591000|122|
# MAGIC |1 |607,220.9782429  |418.676005500|842|
# MAGIC |2 |86,745.8540347   |158.244655800|5,882|
# MAGIC |3 |12,392.2648621   |59.810857940|41,162|
# MAGIC |4 |1,770.3235517    |22.606379400|288,122|
# MAGIC |5 |252.9033645      |8.544408276|2,016,842|
# MAGIC |6 |36.1290521       |3.229482772|14,117,882|
# MAGIC |7 |5.1612932        |1.220629759|98,825,162|
# MAGIC |8 |0.7373276        |0.461354684|691,776,122|
# MAGIC |9 |0.1053325        |0.174375668|4,842,432,842|
# MAGIC |10|0.0150475        |0.065907807|33,897,029,882|
# MAGIC |11|0.0021496        |0.024910561|237,279,209,162|
# MAGIC |12|0.0003071        |0.009415526|1,660,954,464,122|
