# DBTITLE 1,Add H3 Columns for Entire Flight Track (via UDF)
# ::: Standard UDFs :::

import math

@udf
def h3_hex_udf(lat:float, lon:float, resolution:int) -> str:
    """
    UDF to get the H3 value based on lat/lon at a given resolution
    """
    return h3.geo_to_h3(lat, lon, resolution)

schema = StructType([
  StructField("lat", DoubleType(), False),
  StructField("lon", DoubleType(), False)
])

@udf(schema)
def h3_hex_centroid(hex:str) -> Dict[str, float]:
    """
    Get the centroid from a h3 hex location.
    """
    (lat, lon) = h3.h3_to_geo(hex)
    return {
        "lat": lat,
        "lon": lon
    }
    
# ::: Vectorized Pandas UDFs :::

# # Could implement as useful, see https://databricks.com/blog/2020/05/20/new-pandas-udfs-and-python-type-hints-in-the-upcoming-release-of-apache-spark-3-0.html

# COMMAND ----------

# MAGIC %md _Apply the UDFs._

