# DBTITLE 1,K-Ring Variation Example
# MAGIC %md __This approach would capture more data if `h3.k_ring(<h3_id>,1)` were used as data would not be lost at the boundary of a cell, so that is done below.__

# COMMAND ----------

@udf(returnType=ArrayType(StringType()))
def h3_kring_udf(h3_id:str, k:int = 1) -> str:
    """
    UDF to get the H3 indexes within `k` k_rings.
    """
    h3_k_ring = list(h3.k_ring(h3_id, k))
    h3_k_ring.sort
    return h3_k_ring

# COMMAND ----------

df_hex6_kring = (
    df_hex6
        .filter("mph > 275")
        .withColumn("k_rings_1", h3_kring_udf("hex_id",F.lit(1)))
        .select("*", F.explode("k_rings_1").alias("k_ring_1"))
        .drop("k_rings_1", "hex_centroid")
        .orderBy("dt_rank")
)
