# COMMAND ----------

# DBTITLE 1,Window Function for Distances between Messages
# MAGIC %md 
# MAGIC 
# MAGIC __H3 has an API for calculating distances. Let's first see how far we get with just Spark Windowing with H3 `dist` based on Resolutions 8.__ 
# MAGIC 
# MAGIC * `h3_distance`: Returns the distance in grid cells between the two indexes; km based on resolution ([here](https://h3geo.org/docs/api/traversal#h3distance)).
# MAGIC * _Note: Resolution 6 also done but not shown here._

# COMMAND ----------

# ::: Standard UDFs :::

@udf
def h3_distance(h1:str, h2:str) -> int:
    """
    distance between 2 hex_bins.
    - using centroid and resolution
    """
    if h1 is not None and h2 is not None:
        return h3.h3_distance(h1, h2)
    return None

# ::: Vectorized Pandas UDFs :::

# Could implement as useful, see https://databricks.com/blog/2020/05/20/new-pandas-udfs-and-python-type-hints-in-the-upcoming-release-of-apache-spark-3-0.html

# COMMAND ----------

def calc_lag_distances(df, hex_id_col="hex_id", rank_col="dt_rank", dist_list=[1,2,3,4,5,10,15,20]):
    """
    Add columns relating to distance calculation over various lagging entries.
    - This is not a UDF
    """
    df_result = df.select("*")
    for d in dist_list:
        df_result = (
            df_result
                .withColumn(f"hex_lag{d}", F.lag(hex_id_col, d).over(Window.orderBy(rank_col)))
                .withColumn(f"hex_lag{d}_dist", h3_distance(hex_id_col, f"hex_lag{d}"))
        )
    return df_result

# COMMAND ----------

# DBTITLE 1, Window Function @ Resolution 8
df_hex8_lag = calc_lag_distances(df_hex8)
display(df_hex8_lag)

