# DBTITLE 1,Result: Resolution 8
# MAGIC %md _Improves in separation over `Resolution = 6`. Lag5 does not provide enough separation alone though, Lag10 offers the best, Lag15 and Lag20 offer slightly more separation at the expense of time delay._ __Filtering to both `mph > 275` and `hex_lag10_dist < 20` yields the holding pattern only for this flight track while decting 12 entries vs 10 from resolution 6.__

# COMMAND ----------

# DBTITLE 1,Look at Fields: `course`, `mph`, `feet`
# MAGIC %md
# MAGIC 
# MAGIC __Consider `course`:__  
# MAGIC 
# MAGIC > The path that a vessel follows over the ground is called a ground track, course made good or course over the ground. For an aircraft it is simply its track. The intended track is a route. For ships and aircraft, routes are typically straight-line segments between waypoints. A navigator determines the bearing (the compass direction from the craft's current position) of the next waypoint. Because water currents or wind can cause a craft to drift off course, a navigator sets a course to steer that compensates for drift. The helmsman or pilot points the craft on a heading that corresponds to the course to steer. If the predicted drift is correct, then the craft's track will correspond to the planned course to the next waypoint. __Course directions are specified in degrees from north, either true or magnetic. In aviation, north is usually expressed as 360.__ Navigators used ordinal directions, instead of compass degrees, e.g. "northeast" instead of 45 until the mid-20th century when the use of degrees became prevalent.
# MAGIC 
# MAGIC -- https://en.wikipedia.org/wiki/Course_(navigation)

# COMMAND ----------

def calc_lag_diffs(df_hex_lag, lag_cols=['mph','feet','course'], rank_col="dt_rank", dist_list=[1,2,3,4,5,10,15,20]):
    """
    Add columns relating to diff calculation over various lagging entries.
    - change in fields (e.g. 'mph','feet','course') over lag entries (e.g. 1,5,10,15,20)
    - This is not a UDF
    """
    df_result = df_hex_lag.select("*")
    for d in dist_list:
        for c in lag_cols:
            df_result = (
                df_result
                    .withColumn(f"{c}_lag{d}", F.lag(c, d).over(Window.orderBy(rank_col)))
                    .withColumn(f"{c}_lag{d}_diff", col(f"{c}") - col(f"{c}_lag{d}"))
            )
    return df_result

