# MAGIC %md __Note: `Course` has to be handled specially as the difference between 1 and 360 degrees is actually just 1, not 359! All the "changes" between 100 and 130 are therefore not nearly as large as represented, SO THE ABOVE NEEDS TO BE CORRECTED!__

# COMMAND ----------

@udf(returnType=FloatType())
def degree2rad(deg: int) -> float:
    """
    Math function to convert degrees to radians.
    """
    return math.radians(deg)

@udf(returnType=IntegerType())
def abs_deg_diff(d1:int, d2:int) -> int:
    """
    Compare absolute difference between degrees.
    - This will handle 0 .. 360
    - e.g. abs_deg_diff(0, 360) -> 0
    - e.g. abs_deg_diff(1, 360) -> 1
    - e.g. abs_deg_diff(2, 358) -> 4
    - e.g. abs_deg_diff(15, 180) -> 165
    """
    if d1 is None or d2 is None:
        return None
    
    min_abs_diff = min(abs(d1 - d2), abs(d2 - d1))
    
    # actual difference should never be greater than 180
    if min_abs_diff == 360:
        return 0
    elif min_abs_diff > 180:
        return abs(360 - min_abs_diff)
    else:
        return min_abs_diff

