# DBTITLE 1,Course: Standard Deviation (Lag 5,10)
# MAGIC %md __In a holding pattern, course will change much more often than it would otherwise. Let's look at the signal that would come from lagging course changes using standard devation from `deg_diff5` and `deg_diff10`.__

# COMMAND ----------

def stddev_pop_w(col, w):
    """
    Built-in stddev doesn't support windowing.
    """
    return F.sqrt(F.avg(col * col).over(w) - F.pow(F.avg(col).over(w), 2))

